import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ loggedin, setLoggedIn, handleLogout }) => {
 
  return (
    <nav>
      <ul>
        <li><Link to="/"type="button" class="btn btn-secondary">Home</Link></li>
        <li><Link to="/cart"type="button" class="btn btn-secondary">Cart</Link></li>
        <li><Link to="/search"type="button" class="btn btn-secondary">Search</Link></li>
        <li><Link to="/checkout"type="button" class="btn btn-secondary">Checkout</Link></li>
        <li>
          {loggedin ? (
            <button onClick={handleLogout}type="button" class="btn btn-secondary">Logout</button>
          ) : (
            <Link to="/login"type="button" class="btn btn-secondary">Login</Link>
          )}
        </li>
      </ul>
      
    </nav>
  );
};

export default Navbar;
